const List = ({ toDo, deleteTodo }) => {
  const complete = id => {
    deleteTodo(id);
  };
  return (
    <div>
      <button onClick={() => complete(toDo.id)}>完了</button>
      {toDo.content}
    </div>
  );
};

export default List;
